import React from "react";
import TodoItemContainer from "./TodoItemCntainer";

const TodosList = ({ todos }) => {
   return (
      <ul>
         {todos.map((todoItem) => (
            <TodoItemContainer
               key={todoItem.id}
               id={todoItem.id}
               title={todoItem.title}
               isCompleted={todoItem.completed}
            />
         ))}
      </ul>
   );
};

export default TodosList;
